import React from 'react';
import { ThemeProvider } from "./components/theme";
import { Homepage } from './components/pages/homepage';
import { Exercice } from './components/pages/exercice';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

export function App() {
    return (
        <Router>
            <ThemeProvider>
                <Homepage />
            </ThemeProvider>
            <Switch>
                <Route path="/exercice">
                    <Exercice />
                </Route>
            </Switch>
        </Router>
    )
}
